import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Form from './components/Form';

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route path="/" element={<Form />} />
          <Route path="/confirmation" element={<Confirmation />} />
        </Routes>
      </Router>

    </>
  );
}

export default App;
